import Nav from '../Nav/'
import data from '../../data/data.json'

const Header = props => (
  <header>
    <h1><img src ="/static/logo.svg" />{data[0].title}</h1>
    <p>{data[0].description}</p>
    <Nav />
  </header>
);

export default Header;
